`timescale 1ns/1ps

`include "./headers.v"
module SearchBF(input Start, clk, reset, BFQuery, input [`NodeSize-1:0] Length, input [`CRCLength-1:0] CRC_code,
output reg [`NodeSize-1:0] No_of_BF_accesses, output reg BFQueryPos, BFQueryNeg
);

reg [`BF_Size-1: 0] BF=';
wire [`M-1:0] BF_h1_index, BF_h2_index, BF_h3_index, BF_h4_index, BF_h5_index, BF_h6_index;
reg accessflag;
reg BF1;
reg BF01;
reg BF2;
reg BF02;
reg BF3;
reg BF03;
reg BF4;
reg BF04;
reg BF5;
reg BF05;
reg BF6;
reg BF06;
wire bfStart;
//assign BF1 = BF[BF_h1_index];
//assign BF2 = BF[BF_h2_index];
//assign BF3 = BF[BF_h3_index];
//assign BF4 = BF[BF_h4_index];
//assign BF5 = BF[BF_h5_index];
//assign BF6 = BF[BF_h6_index];

//always @(posedge clk or negedge reset)
//    if (!reset | Start) begin BFQueryPos <= 0;  BFQueryNeg <= 0;  end
//    else if ((BF[BF_h1_index]) & (BF[BF_h2_index]) & (BF[BF_h3_index]) & (BF[BF_h4_index]) & (BF[BF_h5_index]) & (BF[BF_h6_index])) begin BFQueryPos <= 1; end
//    else if ((!BF[BF_h1_index] | !BF[BF_h2_index] | !BF[BF_h3_index] | !BF[BF_h4_index] | !BF[BF_h5_index] | !BF[BF_h6_index])) begin BFQueryNeg <= 1; end
//    else begin BFQueryPos <= 0; BFQueryNeg <= 0; end
reg [`CRCLength-1:0] CRC_code_reg;
reg BFQuery_reg;

always @(posedge clk or negedge reset) begin
    if (!reset) begin
        CRC_code_reg <= 0;
        BFQuery_reg <= 0;
    end else begin
        CRC_code_reg <= CRC_code;
        BFQuery_reg <= BFQuery;
    end
end

wire [`M-1:0] BF_h1_index_next = BFQuery_reg ? CRC_code_reg[35:20] : 0;
wire [`M-1:0] BF_h2_index_next = BFQuery_reg ? CRC_code_reg[31:16] : 0;
wire [`M-1:0] BF_h3_index_next = BFQuery_reg ? CRC_code_reg[27:12] : 0;
wire [`M-1:0] BF_h4_index_next = BFQuery_reg ? CRC_code_reg[23:8]  : 0;
wire [`M-1:0] BF_h5_index_next = BFQuery_reg ? CRC_code_reg[19:4]  : 0;
wire [`M-1:0] BF_h6_index_next = BFQuery_reg ? CRC_code_reg[15:0]  : 0;

reg [`M-1:0] BF_h1_index_reg, BF_h2_index_reg, BF_h3_index_reg;
reg [`M-1:0] BF_h4_index_reg, BF_h5_index_reg, BF_h6_index_reg;

always @(posedge clk or negedge reset) begin
    if (!reset) begin
        BF_h1_index_reg <= 0;
        BF_h2_index_reg <= 0;
        BF_h3_index_reg <= 0;
        BF_h4_index_reg <= 0;
        BF_h5_index_reg <= 0;
        BF_h6_index_reg <= 0;
    end else begin
        BF_h1_index_reg <= BF_h1_index_next;
        BF_h2_index_reg <= BF_h2_index_next;
        BF_h3_index_reg <= BF_h3_index_next;
        BF_h4_index_reg <= BF_h4_index_next;
        BF_h5_index_reg <= BF_h5_index_next;
        BF_h6_index_reg <= BF_h6_index_next;
    end
end

always @(posedge clk or negedge reset) begin
    if (!reset) begin
        BF1 <= 0; BF2 <= 0; BF3 <= 0;
        BF4 <= 0; BF5 <= 0; BF6 <= 0;
    end else begin
        BF1 <= BF[BF_h1_index_reg];
        BF2 <= BF[BF_h2_index_reg];
        BF3 <= BF[BF_h3_index_reg];
        BF4 <= BF[BF_h4_index_reg];
        BF5 <= BF[BF_h5_index_reg];
        BF6 <= BF[BF_h6_index_reg];
    end
end
always @(posedge clk or negedge reset) begin
    if (!reset || Start) begin
        No_of_BF_accesses <= 0;
        accessflag <= 0;
    end else if (BFQuery_reg && !accessflag) begin
        No_of_BF_accesses <= No_of_BF_accesses + 1;
        accessflag <= 1;
    end else if (BFQueryPos || BFQueryNeg) begin
        accessflag <= 0;
    end
end
endmodule